import "../Detail.css"

const Activity = ({name, difficult, duration, season}) => {
    return(
        <div className="Activity">
            <h1 className="actName">Activity</h1>
            <h2>Name: <b>{name}</b></h2>
            <h2>Difficulty: <b>{difficult}</b></h2>
            <h2>Duration: <b>{duration}</b></h2>
            <h2>Season: <b>{season}</b></h2>
        </div>
    )
}

export default Activity;
